def input_fn(request_body, request_content_type):
    if request_content_type == 'application/json':
        try:
            data = json.loads(request_body)
            return data
        except json.JSONDecodeError:
            raise ValueError("Invalid JSON in request body")
    else:
        raise ValueError(
            "Unsupported content type: {}".format(request_content_type))


def predict_fn(input_data, model_tuple):
    try:
        model, vocab_dict, vocab_list = model_tuple
        logger.info(f"Received input data: {input_data}")

        if isinstance(input_data, dict) and "text" in input_data:
            text = input_data["text"]
            if not isinstance(text, str):
                raise ValueError("Input 'text' must be a string.")
        else:
            raise ValueError("Invalid input format. Expected a dictionary with 'text' key.")

        input_tensor = tokenize_and_convert_to_tensor(text, vocab_dict)

        model.eval()
        with torch.no_grad():
            output = model(input_tensor)

            output = output.squeeze()
            _, top_idx = output.topk(3)  
            chosen_idx = top_idx[torch.randint(3, (1,))] 
            generated_indices = [chosen_idx.item()]

            for _ in range(20):
                input_tensor = torch.tensor([[generated_indices[-1]]], dtype=torch.long)
                output = model(input_tensor)
                output = output.squeeze()
                _, top_idx = output.topk(3)
                chosen_idx = top_idx[torch.randint(3, (1,))]
                generated_indices.append(chosen_idx.item())

            lyrics = ' '.join([vocab_list.get(str(idx), "<unk>") for idx in generated_indices])
            return lyrics
        
    except Exception as e:
        logger.error(f"Error during prediction: {e}, Input: {input_data}")
        raise RuntimeError(f"Error during prediction: {e}")
    

def tokenize_and_convert_to_tensor(text, vocab_dict):
    try:
        tokens = text.split()
        logger.info(f"Tokenized text: {tokens}")

        token_ids = []
        for token in tokens:
            if token in vocab_dict:
                token_id = vocab_dict[token]
                token_ids.append(token_id)
                logger.info(f"Token '{token}' found with ID: {token_id}")
            else:
                logger.error(f"Token '{token}' not found in vocab_dict")
                token_ids.append(vocab_dict['<unk>'])

        tensor = torch.tensor([token_ids], dtype=torch.long)
        return tensor
    except Exception as e:
        logger.error(f"Error in tokenization: {e}, Text: {text}")
        raise RuntimeError(f"Error in tokenization: {e}")


def convert_output_to_lyrics(output, vocab_list):
    _, predicted_indices = torch.max(output, 2)
    predicted_indices = predicted_indices[0].tolist()

    logger.info(f"Predicted indices: {predicted_indices}")

    predicted_words = [vocab_list.get(str(idx), "<unk>") for idx in predicted_indices]
    logger.info(f"Predicted words: {predicted_words}")

    lyrics = ' '.join(predicted_words)
    logger.info(f"Generated lyrics: {lyrics}")

    return lyrics


def output_fn(prediction, response_content_type):
    if response_content_type == 'application/json':
        try:
            return json.dumps({"lyrics": prediction})
        except TypeError as e:
            logger.error(f"Error in output function: {str(e)}")
            raise ValueError("Cannot serialize the prediction to JSON")
    else:
        raise ValueError("Unsupported response content type: {}".format(response_content_type))